import React from "react";


export default class Movie extends React.Component{
    render(){
        return(

            <li key={this.props.idx}>
            <p> {this.props.item.title} </p>
            <p>{this.props.item.overview}</p>
            <p>{this.props.item.average_votes}</p>
            <p>{this.props.item.total_votes}</p>
            <img src={this.props.item.image_url} alt='movieImage'/>
            <p>{this.props.item.popularity}</p>
            <p>{this.props.item.released_on}</p>
        </li>
        )
    }


